function registerServiceWorker(e){e.waiting?console.log("Service Worker is waiting"):e.installing?trackInstalling(e.installing):e.addEventListener("updatefound",(function(){console.log("New Service Worker was Found!"),trackInstalling(e.installing)}))}function trackInstalling(e){e.addEventListener("statechange",(function(){"installed"===e.state&&console.log("New Service Worker was installed")}))}navigator.serviceWorker.register("/sw.js").then(registerServiceWorker);